import React from 'react';

class App {
    render() {
      const myStyle={
          backgroundImage: 
   "url('https://www.planetware.com/wpimages/2020/02/france-in-pictures-beautiful-places-to-photograph-eiffel-tower.jpg')",
          height:'100vh',
          marginTop:'-70px',
          fontSize:'50px',
          backgroundSize: 'cover',
          backgroundRepeat: 'no-repeat',
      };
      return (
        <div style={myStyle}>
          <h1> geeksforgeeks </h1>
        </div>
      );
    }
  }
     
  export default App;
